import React from 'react'
import { Nav, NavItem, NavLink,  } from 'reactstrap';
import {Link, useParamsRoute} from 'react-router-dom'

const Header = () => {
    const { id } = useParams();

    return (
        <div>
            <Nav tabs>
        <NavItem>
          <Link  to='/market/1'>Home</Link>
        </NavItem>
       <NavItem>
       <Route path = '/market/:id' />
        </NavItem>
        
      </Nav>
            
        </div>
    )
}

export default Header
